export default function AnimalDetail({animal}) {
    const{name,image,description,likes} = animal
  return (
    <div className="animal-div">
      <img className="animal-image"src={image} alt={name} />
      <h2 className="animal-name">{name}</h2>
      <p className="animal-facts"> {description}</p>
      <p className="animal-likes">Likes: {likes}</p>
    </div>
  );
}
